DROP TABLE IF EXISTS rsids;

CREATE TABLE IF NOT EXISTS rsids
(
    id     INTEGER PRIMARY KEY AUTOINCREMENT,
    chrom  INTEGER NOT NULL,
    pos    INTEGER NOT NULL,
    rsid   TEXT    NOT NULL,
    ref    TEXT    NOT NULL,
    alt    TEXT    NOT NULL,
    format TEXT    NOT NULL
);

CREATE INDEX rsids_rsid_inx ON rsids (rsid);

